import './NavBarMobile.css'
import logoMobile from '../../../../images/logos/logo-mobile-black.svg';
import logoShort from '../../../../images/logos/logo-short-dark.svg';
// import close from '../../../../images/icons/nav-close.svg';
// import hamburger from '../../../../images/icons/nav-hamburger.svg';
import instagram from '../../../../images/social/social-insta-green.svg';
import linkedin from '../../../../images/social/social-linkedin-green.svg';
import twitter from '../../../../images/social/social-twitter-green.svg';

import { useState } from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { useHistory } from 'react-router-dom';


function NavBarMobile() {
  const history = useHistory();
  const [isOpen, setIsOpen] = useState(false);

  const handleLogoClick = () => {
    setIsOpen(false);
    history.push('/')
  }

  return (
    <Navbar expand="md" collapseOnSelect onToggle={() => setIsOpen(!isOpen)} expanded={isOpen} className={isOpen ? 'navbar__dark' : ''}>
      <Navbar.Brand onClick={() => handleLogoClick()} style={{ marginLeft: 30, marginBottom: 15 }}>
        <img src={logoShort} className={`${isOpen ? '' : 'd-none'}`} alt="Eco-Packers logo" />
        <img src={logoMobile} className={`${isOpen ? 'd-none' : ''}`} alt="Eco-Packers logo" />
      </Navbar.Brand>

      <Navbar.Toggle aria-controls="basic-navbar-nav" style={{ marginBottom: 15 }}>
        {/* <img src={close} className={`${isOpen ? 'navBar__toggle-close' : 'd-none'}`} alt="Close icon" /> */}
        {/* <img src={hamburger} className={`${isOpen ? 'd-none' : 'navBar__toggle-hamburger'}`} alt="Hamburger menu icon" /> */}
      </Navbar.Toggle>

      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
          <Nav.Link eventKey="2" onClick={() => history.push('/solutions/inputs')}>Solutions</Nav.Link>
          {/* {config.isFaqEnabled &&
            <Nav.Link eventKey="8" onClick={() => history.push('/faq')}>FAQ</Nav.Link>
          } */}
          <Nav.Link eventKey="3" onClick={() => history.push('/partners')}>Partners</Nav.Link>
          <Nav.Link eventKey="4" onClick={() => history.push('/media')}>Media</Nav.Link>
          <Nav.Link eventKey="5" onClick={() => history.push('/about')}>About</Nav.Link>
          <Nav.Link eventKey="6" onClick={() => history.push('/contact')}>Contact Us</Nav.Link>

          <div className="navBar__footnotes" >
            <Nav.Link eventKey="7" onClick={() => history.push('/terms')} className="navBar__footnote">Terms & Conditions</Nav.Link>
            <Nav.Link eventKey="7" onClick={() => history.push('/privacy')} className="navBar__footnote">Privacy Policy</Nav.Link>
            <span className="navBar__footnote">erthos&trade; &copy; 2020. All Rights Reserved</span>
          </div>
          <div className="d-flex justify-content-between" style={{ maxWidth: 190, marginLeft: 30, marginTop: 20, marginBottom: 30 }}>
            <a href="https://twitter.com/planeterthos/">
              <img src={twitter} alt="Twitter logo" />
            </a>
            <a href="https://www.linkedin.com/company/erthosinc">
              <img src={linkedin} alt="Linkedin logo" />
            </a>
            <a href="https://www.instagram.com/planeterthos/">
              <img src={instagram} alt="Instagram logo" />
            </a>
          </div>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default NavBarMobile;
